DROP TABLE IF EXISTS `t_hc_community_post`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `t_hc_community_post` (
  `PID` int NOT NULL AUTO_INCREMENT COMMENT '帖子id',
  `TID` int DEFAULT NULL COMMENT '帖子主题id',
  `PCID` int DEFAULT NULL COMMENT '帖子评论id',
  `TITLE` varchar(200) DEFAULT NULL COMMENT '帖子标题',
  `CONTENT` longtext COMMENT '帖子内容',
  `POSTWITHPICTURES` varchar(200) DEFAULT NULL COMMENT '帖子配图',
  `INTRODUCTION` varchar(200) DEFAULT NULL COMMENT '帖子简介[如果此字段为空时 则取帖子内容字段值前100个字符]',
  `AUDITSTATUS` int DEFAULT '10' COMMENT '审核状态 [10 已发帖] [20 帖子审核中] [30 帖子审核通过] [40 帖子审核不通过]',
  `AUDITDESCRIPTION` varchar(200) DEFAULT NULL COMMENT '审核描述',
  `SORT` int DEFAULT '0' COMMENT '排序 0 普通  1 置顶',
  `VIEWS` int DEFAULT '0' COMMENT '浏览量',
  `FABULOUS` int DEFAULT '0' COMMENT '点赞量',
  `AUTHORNAME` varchar(200) DEFAULT NULL COMMENT '发帖者',
  `RMSTATUS` int DEFAULT '20' COMMENT '删除状态 [10 删除] [20 没删除]',
  `GMTCREATE` datetime DEFAULT NULL COMMENT '创建时间',
  `GMTUPDATE` datetime DEFAULT NULL COMMENT '修改时间',
  `EXTERNALURL` varchar(255) DEFAULT NULL COMMENT '外部URL链接',
  PRIMARY KEY (`PID`)
) ENGINE=InnoDB AUTO_INCREMENT=48 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='帖子表';
/*!40101 SET character_set_client = @saved_cs_client */;

