INSERT INTO `t_hc_community_post` VALUES (23,2,23,'新华社：宝钢股份以“智慧管理”将“智慧生产”连点成面','<p><img src=\"http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_20221121091941.png\" style=\"max-width:100%;\" contenteditable=\"false\"/></p>','http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_20221121091941.png','新华社：宝钢股份以“智慧管理”将“智慧生产”连点成面',30,'审核通过',0,0,0,'小慧',20,'2022-11-21 09:20:56','2022-11-21 09:20:56','https://mp.weixin.qq.com/s/iQMWfxwEsf8DXQZv2TGlpw'),(25,3,25,'双周回顾（20221008-20221021）','<p><img src=\"http://test-www.ibaosteel.com/ibaosteel/static/community/post/1667788997475907.jpg\" style=\"max-width:100%;\" contenteditable=\"false\" width=\"100%\"/></p>','http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_20221121093510.png','双周回顾（20221008-20221021）',30,'审核通过',0,16,0,'小慧',20,'2022-11-21 09:36:03','2022-11-21 09:36:03',''),(27,3,27,'双周回顾(20221031-20221104)','<p><img src=\"http://test-www.ibaosteel.com/ibaosteel/static/community/post/1667788997475907.jpg\" style=\"max-width:100%;\" contenteditable=\"false\" width=\"100%\"/></p>','http://test-www.ibaosteel.com/ibaosteel/static/community/post/1.png','双周回顾(20221031-20221104)',30,'审核通过',0,52,0,'小慧',20,'2022-11-21 10:49:57','2022-11-21 10:49:57',''),(32,2,32,'宝钢股份获安永可持续发展年度最佳奖项2022杰出个人、优秀案例','<section><section><p><img src=\"http://test-www.ibaosteel.com/ibaosteel/static/community/post/image.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/></p></section><section><section><section><section><section><section><section><section><p>2022年11月18日，安永首届“上市公司可持续发展官高峰论坛暨年度最佳奖项评选”活动公布评选结果。</p><p><br/></p><p>宝钢股份“双碳”战略实施摘取年度<strong>优秀案例</strong>——科技创新进步，公司副总经理傅建国荣获年度<strong>杰出个人</strong>奖项。</p></section></section></section></section></section></section></section></section><section><section><section><section><section><section><section><section><section><section><p><br/></p></section></section></section></section><section><section><p>本次活动的主题是“创长期价值，绘可信未来”。评选广泛发掘引领中国可持续发展的先驱典范，围绕绿色发展、乡村振兴、共同富裕等国家重大战略，参考全球最新的可持续发展评估体系和ESG标准，综合考虑商业、社会和技术影响，最终由独立评委会做出评选结果，希望能够通过表彰做出突出贡献的企业、个人和案例，充分展现我国高质量发展的最新实践经验与成果，探索更多可持续发展的新模式、新路径，鼓励更多企业在国家高质量发展进程中发挥积极的引领作用，从而促进商业与社会环境的共赢发展。</p></section></section></section></section></section></section></section></section><section><section><section><section><section><section><section><section><p>傅建国先生受邀出席活动，发表主题演讲——《宝钢股份绿色低碳探索与实践》，并领取奖项。</p><p><br/></p><p>作为钢铁行业引领者，宝钢股份积极响应“3060双碳”的国家战略，确定了力争实现“2023年碳达峰、2050年碳中和”的战略目标，制定了“技术革新、产品创新，打造绿色钢铁生态圈”的战略实施方案，取得了阶段性成果，“双碳”战略得到了全面贯彻落实。</p><p><br/></p><p>面向未来，公司将秉承绿色低碳理念，始终坚守“发展与绿色同步”价值观，积极推动钢铁绿色产业链建设，同时携手产业链伙伴共同探索与践行绿色低碳发展，为行业高质量可持续发展贡献力量。</p></section></section></section></section></section></section></section></section></section><section><section><section><br/></section></section></section>','http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_20221121133838.png','宝钢股份获安永可持续发展年度最佳奖项2022杰出个人、优秀案例',30,'审核通过',0,0,0,'小慧',20,'2022-11-21 01:40:43','2022-11-21 01:40:43','https://mp.weixin.qq.com/s/t5Fna_4nxW04-0Ph6ooFLw'),(33,2,33,'重塑钢铁行业在人类可持续发展进程中的关键地位','<p><img src=\"http://test-www.ibaosteel.com/ibaosteel/static/community/post/3.png\" style=\"max-width:100%;\" contenteditable=\"false\"/></p>','http://test-www.ibaosteel.com/ibaosteel/static/community/post/3.png','重塑钢铁行业在人类可持续发展进程中的关键地位',30,'审核通过',0,0,0,'小慧',20,'2022-11-21 02:35:47','2022-11-21 02:35:47','https://mp.weixin.qq.com/s/uhS3KgmrHrTWFckWPL4Xxw'),(37,2,37,'成为最早可向车企提供具有明确减碳值产品的中国钢企！宝钢股份与北京奔驰签署《备忘录》','<p><img src=\"http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_20221123102340.png\" style=\"max-width:100%;\" contenteditable=\"false\"/></p>','http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_20221123102340.png','成为最早可向车企提供具有明确减碳值产品的中国钢企！宝钢股份与北京奔驰签署《备忘录》',30,'审核通过',0,0,0,'小慧',20,'2022-11-23 10:25:02','2022-11-23 10:25:02','https://mp.weixin.qq.com/s/eLHy3LphT4oy8nBOjx2-tg'),(38,2,38,'一图读懂｜宝钢股份与北京奔驰“绿钢”之旅','<p>一图读懂｜宝钢股份与北京奔驰“绿钢”之旅<img src=\"http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_20221213231815.png\" contenteditable=\"false\" style=\"font-size: 12px; max-width: 100%;\"/></p>','http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_20221213231815.png','一图读懂｜宝钢股份与北京奔驰“绿钢”之旅',30,'审核通过',0,0,0,'小慧',20,'2022-12-13 11:19:43','2022-12-13 11:19:43','https://mp.weixin.qq.com/s/VkYloKXU1TAOXMrZaGeqzw'),(39,2,39,'战危机 创一流 | 持续增强核心竞争力，赋能企业高质量发展','<p><img src=\"http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_20230112102326.png\" style=\"max-width:100%;\" contenteditable=\"false\"/></p>','http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_20230112102326.png','战危机 创一流 | 持续增强核心竞争力，赋能企业高质量发展',30,'审核通过',0,1,0,'小慧',20,'2023-01-12 10:24:31','2023-01-12 10:24:31','https://mp.weixin.qq.com/s/WydupPuQyd41giWnPCEb-Q'),(40,2,40,'兔飞猛进｜宝钢热轧超薄超高强热处理产品填补国内市场空白','<p>　　近日，宝钢薄规格热处理产线（2-6mm）建成投产，首批产品已陆续交付用户使用，产品质量得到用户认可。宝钢热处理产品质量、供货能力、资源保证持续提升！<br/>　　宝钢热轧聚力攻坚关键核心技术，一举填补国内空白，改变了薄规格超高强钢（特别是＜3mm厚度960Mpa级别）依赖进口的局面，满足行业内对此类产品的严苛要求，推动产业链整体升级迭代。<br/>　　产品优势<br/>　　相对传统热处理产线：<br/>　　☆<br/>　　集约热处理生产，性能更加稳定，有效改善加工成型精度<br/>　　☆<br/>　　最新冷却工艺，有效改善钢板内应力，有效改善分条旁弯现象<br/>　　☆<br/>　　保护性气氛，表面氧化层更均匀，有效解决黑灰问题<br/>　　DreamECO<br/>　　宝钢热轧梦想商用车整体解决方案不断充实，BS系列高强热处理产品（屈服强度600MPa-1300MPa）全新上线！其中堪称热轧吉帕钢的首批2.0mm薄规格BS960E产品将应用于随车吊吊臂，替代原进口产品。<br/>　　质量可靠<br/>　　超高强度<br/>　　高板形<br/>　　优质表面<br/>　　良好低温韧性<br/>　　可焊接性<br/>　　冷成形性<br/>　　广泛应用<br/>　　起重机、高空作业车、泵车等工程机械及车辆结构等。<br/>　　&gt;&gt;左右滑动查看更多应用场景&lt;&lt;<br/>　　What is EcoSPEV<br/>　　根据国家标准GB/T 17350《专用汽车和专用半挂车术语、代号和编制方法》，专用汽车（special purpose motor vehicle）定义为：“装置有专用设备，具备专用功能，用于承担专门运输任务或专项作业以及其他专项用途的汽车。”是半挂车、自卸车、罐式车、起重举升车、特种结构车等专用载货汽车及专用作业类车辆的统称。<br/>　　近年来，宝钢携手工程机械行业龙头用户，围绕新产品、新技术应用升级，共同推进超高强热处理产品国产化替代，基本实现国产超高强先进材料在行业内的批量应用，从而推动中国工程机械制造业全供应链制造水平整体提升。<br/>　　2023万物启新，宝钢热轧热处理产销研团队将积极拓展市场需求，发挥产线优势，推动薄规格产品在高空作业车、农机等行业应用，实现同类产品全面进口替代。<br/>　　宝钢热轧<br/>　　在新产品、新工艺、新技术等方面持续创新，<br/>　　以整体解决方案助力商用车升级换代，<br/>　　形成行业示范效应，<br/>　　成为实现“碳达峰、碳中和”的领先者。<br/>　　让“制造绿色”梦想发生<br/>　　图片<br/>　　供稿：宝钢热轧热处理产销研团队，摄影：刘继鸣<br/>　　收录于合集#宝钢热轧<br/>　　9个<br/>　　上一篇我们把阳光给你｜宝钢建筑用材解决方案光伏支架系统Bekind™-PV成就绿色低碳未来<br/>　　阅读3092<br/>　　分享收藏<br/>　　215</p>','http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_20230131162750.png','兔飞猛进｜宝钢热轧超薄超高强热处理产品填补国内市场空白',30,'审核通过',0,1,0,'小慧',20,'2023-01-31 04:31:07','2023-01-31 04:31:07','https://mp.weixin.qq.com/s/At56qaf_mcuw4yKofvXM4Q'),(44,1,44,'宝钢股份2023年3月份电镀锡（铬）品种 国内期货销售价格调整的公告','<p>&nbsp; &nbsp; &nbsp; &nbsp;经公司研究决定，2023年3月份宝山电镀锡（铬）、梅山、武钢日铁电镀锡产品在2月份的基础上调整如下：</p><p>　　一、宝山基地</p><p>　　1、电镀锡：基价上调150元/吨。</p><p>　　2、电镀铬：基价上调150元/吨。</p><p>　　二、梅山、WINSteel镀锡</p><p>　　基价上调150元/吨。</p><p>　　三、提前订货最大优惠由100元/吨调整为50元/吨。</p><p>　　四、其它政策维持不变，以上价格均为不含税价格，调整通知自公布之日起生效执行。</p><p>　　五、本价格调整通知的解释权属宝山钢铁股份有限公司营销中心（宝钢国际）。</p><p>　　&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;宝山钢铁股份有限公司</p><p>　　&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;营销中心（宝钢国际）</p><p>　　&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;二〇二三年一月三十一日</p><p><img src=\"http://test-www.ibaosteel.com/ibaosteel/static/community/post/512.png\" style=\"max-width:100%;\" contenteditable=\"false\"/></p>','http://test-www.ibaosteel.com/ibaosteel/static/community/post/3.jpg','宝钢股份2023年3月份电镀锡（铬）品种 国内期货销售价格调整的公告',30,'审核通过',1,107,0,'小慧',20,'2023-02-01 09:25:58','2023-02-01 09:25:58',''),(45,2,45,'@所有人：8款「宝钢」幸运，总有一款适合你！','<p><img src=\"http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_20230201093234.png\" style=\"max-width:100%;\" contenteditable=\"false\"/></p>','http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_20230201093234.png','@所有人：8款「宝钢」幸运，总有一款适合你！',30,'审核通过',0,1,0,'小慧',20,'2023-02-01 09:34:19','2023-02-01 09:34:19','https://mp.weixin.qq.com/s/2DlGz4v3xunb3dEImAuLSA'),(46,2,46,'“视界” · 汽车安全大会丨专访宝钢股份汽车板首席工程师 鲍平','<p><img src=\"http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_20230213094537.png\" style=\"max-width:100%;\" contenteditable=\"false\"/></p>','http://test-www.ibaosteel.com/ibaosteel/static/community/post/微信截图_2023